import React, { useState } from "react";
import "./App.css";

export const App = () => {
  return (
    <>
      <div className="todoAdd">
        <input placeholder="TODOを追加" />
        <button>追加</button>
      </div>
      <div className="incompleteArea">
        <ul>
          <li>
            <div>
              <ls>
                <p>ああ</p>
                <button>追加</button>
                <button>削除</button>
              </ls>
            </div>
          </li>
        </ul>
      </div>
      <div></div>
    </>
  );
};
